# Last-opened: 0
# Modify the "Last-opened" comment to set the current time
# It's done in order to place the scriptlet to the top of recently read booklist
timestamp=$(date +%s)
sed -i "s/^# Last-opened:.*/# Last-opened: $timestamp/" "$0"


